import React, { Component } from 'react';
import barg from "../../Assets/barg.png"
// import Bigbarg from "../../Assets/Bigbarg.png"

import { BoxContainer, TextBox, Textbox_center, TextboxBtn, Textbox_1, Textbox_end, Textbox_endmini, Text_end_menu, Bigbarg } from './box.js';

 class Box extends Component {
  render() {
    return (
    <BoxContainer>
        <TextBox> <Textbox_1> Growing Beautiful Plants at Home</Textbox_1> <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Doloremque aspernatur, impedit nam rerum tempore optio quibusdam enim consequuntur excepturi, veritatis sunt consequatur commodi aut. Ut blanditiis quaerat neque commodi magni?</p> 
          <Textbox_center> <TextboxBtn>Learn More</TextboxBtn>  </Textbox_center>
<Text_end_menu>
            <Textbox_end>2000+ <Textbox_endmini>Delivery</Textbox_endmini></Textbox_end>
            <Textbox_end>1200+ <Textbox_endmini>Customers</Textbox_endmini></Textbox_end>
            <Textbox_end>1000+<Textbox_endmini>Product</Textbox_endmini></Textbox_end>
</Text_end_menu>
         </TextBox> 
         {/* <Bigbarg src={Bigbarg}/>  */}
    </BoxContainer>
    )
  }
}
export default Box;
